INSERT INTO `contest` VALUES (35,'2017 전반기 프로그래밍 경진대회 기출','<p>2017년 전반기 프로그래밍 경진대회 기출문제 입니다.</p>\n','2017-11-12 22:21:16','2017-12-31 12:59:00'),(37,'2017 후반기 프로그래밍 경진대회','<ol>\n	<li>C언어 혹은 Java 언어를 이용해서 프로그램을 작성해야 합니다.</li>\n	<li>작성한 프로그램은 입력 후 <strong>1초이내에 답을 출력해야</strong> 합니다. 1초이상 시간이 걸리면 틀린 것으로 간주합니다.</li>\n	<li>주어진 문제를 자세히 읽고 완전히 이해한 후에 프로그램을 작성하고, 문제가 이해가 안 되는 부분은 조교를 통해 질문하세요.</li>\n	<li>문제에서 <strong>주어진 입출력 형식을 반드시 따라야</strong> 하며, 별도의 출력(예를 들어, &ldquo;정수 n=?&rdquo;)을 하면 안됩니다.</li>\n	<li>대회 중에는 <strong>인터넷 접속 및 메신저 접속, 참고서적 열람이 금지</strong>되며, 이를 어길 시에는 강제 퇴실됩니다.</li>\n</ol>\n','2017-11-28 17:29:33','2017-11-28 19:30:00');
/*!40000 ALTER TABLE `contest` ENABLE KEYS */;
