INSERT INTO `question` VALUES (132,'이은정','[베타테스트용] 간단한 합계 프로그램','<p>다음과 같은 기능을 하도록 자바 프로그램을 작성하세요.</p>\n\n<p>숫자 여러 개가 들어오고 0이 입력되면 입력이 끝난&nbsp;것으로 본다.</p>\n\n<p>입력된 숫자의 합계를 출력한다. (숫자 하나만 출력되어야&nbsp;함)</p>\n\n<p>&nbsp;</p>\n\n<p>예1:</p>\n\n<p>2 3 4 5 0</p>\n\n<p>14</p>\n\n<p>예2:</p>\n\n<p>11 22 33 44 0</p>\n\n<p>110</p>\n','9f025d5edbeb3334e989ec24f6e8dab0','false','하',NULL,NULL,2,'20000251',NULL,'2017-09-11 03:23:54'),(133,'이은정','[베타테스트] 우수 선수 수 계산 프로그램','<p>다음은 한 줄에 선수의 시도 기록이 저장되어 있다. 여러 번의 시도 점수가 나오고 0이 나오면 그 선수의 점수가 끝난 것으로 본다.</p>\n\n<p>점수 없이 바로 0이 들어오면 선수 입력이 종료된 것으로 본다.</p>\n\n<p>각 선수의 점수에서&nbsp;최대값 45 이상, 최소값 10 이상인 경우를 우수 선수라고 한다.</p>\n\n<p>입력예)</p>\n\n<p>&nbsp; &nbsp;4 &nbsp; 14 &nbsp; &nbsp;6 &nbsp; &nbsp;20 &nbsp; 40 &nbsp; 28 &nbsp; &nbsp;0<br />\n&nbsp; &nbsp;31 &nbsp; 36 &nbsp; 12 &nbsp; 27 &nbsp; &nbsp;0<br />\n&nbsp; &nbsp;41 &nbsp; 22 &nbsp; &nbsp;1 &nbsp; &nbsp;5 &nbsp; &nbsp;0<br />\n&nbsp; &nbsp;31 &nbsp; 23 &nbsp; 14 &nbsp; &nbsp;9 &nbsp; 39 &nbsp; 28 &nbsp; &nbsp;0<br />\n&nbsp; &nbsp; 24 &nbsp; 37 &nbsp; 14 &nbsp; &nbsp;46 0<br />\n&nbsp; &nbsp;27 &nbsp; 41 &nbsp; &nbsp;9 &nbsp; 13 &nbsp; 47 &nbsp; 47 &nbsp; 16 &nbsp; 0<br />\n&nbsp; &nbsp;26 &nbsp; &nbsp;8 &nbsp; 34 &nbsp; 45 &nbsp; 34 &nbsp; &nbsp;0<br />\n0</p>\n\n<p>결과)</p>\n\n<p>1</p>\n\n<p>결과는 숫자 하나만 나와야 하고 그 이외의 표시나 문자가 출력되면 오류로 처리된다.</p>\n\n<p>위 예에서는 다섯번째 선수가 최대 46, 최소 14여서 우수 선수이고 나머지는 다 조건을 만족하지 않는다.</p>\n\n<p>프로그램 작성시 각 선수의 점수를 처리하는 클래스를 만들고 그것을 관리하는 클래스를 따로 만들어 주세요.</p>\n','2e8a504464d5b434124999e8c65aa42a','false','중',NULL,NULL,2,'20000251',NULL,'2017-09-11 03:23:54'),(134,'이은정','[베타테스트] 학생 이름 바꾸기','<p>학생정보가 다음과 같이 아이디 이름 성별(m/f), 학년으로 입력된다.</p>\n\n<p>1 kim m 3</p>\n\n<p>이것을 학생 클래스 객체 배열에 읽어들여 1, 2, 3, 4학년 순서대로 여학생의 이름을 출력하도록 프로그램을 작성하시오.</p>\n\n<p>단 이름은 같은 이름이 있는 경우 kim, kim(1), kim(2) 이런 식으로 번호를 붙여 나가서 구분해 준다.</p>\n\n<p>입력예)</p>\n\n<p>1 lee 3 m<br />\n2 kim 4 m<br />\n3 cho 3 f<br />\n4 park 2 m<br />\n5 kang 3 f<br />\n6 lee 2 m<br />\n0</p>\n\n<p>출력예)</p>\n\n<p>cho kang&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>입력예2)</p>\n\n<p>1 lee 3 m<br />\n2 kim 4 m<br />\n3 cho 3 f<br />\n4 park 1 f<br />\n5 kang 3 f<br />\n6 lee 2 f<br />\n7 kim 3 f<br />\n8 choi 1 f<br />\n9 chung 2 f<br />\n0</p>\n\n<p>출력예2)</p>\n\n<p>park choi&nbsp;lee(1) chung&nbsp;cho kang kim(1)&nbsp;</p>\n\n<p>* 설명 : lee와 kim은 각각 두번째 나온 학생이 여학생이므로 lee(1)과 kim(1)로 표시되었고 학년별 여학생이 나온 순서대로 출력된다.</p>\n','0a504875692f8cf7310792d7067461d5','false','중',NULL,NULL,2,'20000251',NULL,'2017-09-11 03:23:54'),(136,'관리자','프로그래밍 연습용 페이지, [절대 삭제 금지]','<p>프로그래밍 연습을 위한 페이지.</p>\n','80d3aef5b3a842358f1ab4969cd86ccc','true','중',NULL,NULL,2,'201215595',NULL,'2017-09-11 03:23:54'),(162,'이현','테스트 문제 1','<p>&quot;냐옹이&quot;를 출력하세요.</p>\n','2e13e3a7643647c8ce88264fd3bbfbc3','false','하','2017-09-11 16:38:05','2017-09-20 16:38:00',2,'201611841',24,'2017-09-11 03:23:54'),(163,'이현','테스트 문제 2','<p>&quot;강아지&quot;를 출력하세요.</p>\n','006e68ee64725eece964b441fbc80eb4','false','하','2017-09-11 16:38:05','2017-09-20 16:38:00',2,'201611841',24,'2017-09-11 03:23:54'),(166,'이현','테스트 문제 3','<p>&quot;쫄쫄이&quot;를 출력하세요.</p>\n','e80d5bd23b562b9cc0b07d68dcc310bb','false','하','2017-09-11 16:41:23','2017-09-20 16:38:00',2,'201611841',24,'2017-09-11 16:43:22'),(167,'이현','테스트 문제 4','<p>&quot;꾸에엑&quot;을 출력하세요.</p>\n','bb0bfc20aacfe88bbb6b360fc52f6f95','false','하','2017-09-12 14:01:00','2017-09-20 16:38:00',2,'201611841',24,'2017-09-11 18:18:05'),(178,'이현','qdwqwdqdw','<p>wqwqqq</p>\n','547732076d3e4a59596681c764439ad4','false','중','2017-11-17 05:05:00','2017-11-24 05:05:00',2,'201611841',30,'2017-11-09 05:05:45'),(185,'관리자','최대공약수','<p>어떤 자연수의 약수는 그 자연수를 나누었을 때 나머지가 0이 되는 자연수를 말한다. 두 자연수 <em>N</em>과 <em>M</em>의 최대공약수란 <em>N</em>의 약수이면서 <em>M</em>의 약수이기도 한 수들 중에 가장 큰 것을 말한다.</p>\n\n<p>두 자연수 <em>N</em>과 <em>M</em>이 입력으로 주어질 때, <em>N</em>과 <em>M</em>의 최대공약수를 계산하여 출력하는 프로그램을 작성하시오.</p>\n\n<p><strong>입력</strong></p>\n\n<p>어떤 자연수의 약수는 그 자연수를 나누었을 때 나머지가 0이 되는 자연수를 말한다. 두 자연수 <em>N</em>과 <em>M</em>의 최대공약수란 <em>N</em>의 약수이면서 <em>M</em>의 약수이기도 한 수들 중에 가장 큰 것을 말한다.</p>\n\n<p><strong>출력</strong></p>\n\n<p>두 자연수 <em>N</em>과 <em>M</em>이 입력으로 주어질 때, <em>N</em>과 <em>M</em>의 최대공약수를 계산하여 출력하는 프로그램을 작성하시오.</p>\n','2cb4b39196c33ec0d381cbc07914b37a','false','하','2017-11-12 22:23:31','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 22:26:39'),(186,'관리자','3N+1','<p>유명한 3N+1 문제는 Collatz에 의해 처음 제안되었고 다음과 같은 함수를 바탕으로 한다.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img src=\"http://latex.codecogs.com/gif.latex?F(N)=\\left\\{\\begin{matrix}&amp;space;\\frac{N}{2},N is Even&amp;&amp;space;&amp;&amp;space;\\\\&amp;space;3N+1,N is&amp;space;Odd&amp;space;&amp;&amp;space;\\end{matrix}\\right.\" /></p>\n\n<p>&nbsp;</p>\n\n<p>3N+1 문제는 모든 자연수 <em>N</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:15pt; width:8.25pt\" /> 에 대해 위의 함수를 반복적으로 적용하면 최종적으로는 1에 도달하게 되는지에 대한 질문이다. <em>N</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:15pt; width:8.25pt\" /> 이 <em>2</em><em>60</em>&nbsp;이하인 경우에는 항상 <em>F</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.png\" style=\"height:15pt; width:7.5pt\" /> 를 반복적으로 적용하여 1에 도달할 수 있음을 실험적으로 확인한 바 있다고 한다.</p>\n\n<p>예를 들면, <em>N=6</em>&nbsp;에서 시작한다면, <em>F</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.png\" style=\"height:15pt; width:7.5pt\" /> 를 8번 적용하면</p>\n\n<p><strong>&nbsp;&nbsp;&nbsp; 6 -&gt;&nbsp;3 -&gt; 10 -&gt; 5 -&gt;&nbsp;16 -&gt; 8 -&gt; 4 -&gt; 2 -&gt; 1</strong></p>\n\n<p>와 같이 1에 도달하게 된다.</p>\n\n<p>1에 도달한 후에는 더이상 <em>F</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.png\" style=\"height:15pt; width:7.5pt\" /> 를 적용하지 않으며, 따라서 6이 1이 되기까지 <em>F</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.png\" style=\"height:15pt; width:7.5pt\" /> 의 적용횟수는 8회라고 일컫는다. 참고로, <em>N=1</em>&nbsp;인 경우 필요한 <em>F&nbsp;</em>의 적용횟수는 0회이다,</p>\n\n<p>임의의 1이상의 정수 <em>N</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:15pt; width:8.25pt\" /> 이 주어질 경우에 1이 되기까지의 <em>F</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image003.png\" style=\"height:15pt; width:7.5pt\" /> 의 적용횟수를 계산하는 프로그램을 작성하시오.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>입력</strong></p>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 한 줄에 정수 <em>N</em>이 주어진다. <em>N</em>는 최소 1, 최대 100,000이다.</p>\n\n<p><strong>출력</strong></p>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 정수 <em>N</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:15pt; width:8.25pt\" /> 에 대하여 1이 되기까지의 <em>F</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image002.png\" style=\"height:15pt; width:7.5pt\" /> 의 적용횟수를 정확히 정수 형태로 출력한다</p>\n','a360a628e988ebae731646597a37b11d','false','중','2017-11-12 22:45:00','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 22:44:42'),(187,'관리자','Euler’s Phi Function','<p>18세기 수학자 오일러(Euler)는 수많은 업적을 남겼으며, 우리는 덕분에 수학이나 물리 혹은 컴퓨터 관련 전공 내용에서도 심심찮게 그의 이름을 들을 수 있게 되었다.<br />\n그의 이름을 따온 공식이나 정리는 수없이 많은데, 그 중에 오일러의 파이 함수 (Euler&rsquo;s &phi; function)는 암호나 보안 분야에서도 응용되고 있다.</p>\n\n<p>오일러의 파이 함수 <em>&phi;</em>는 임의의 자연수 <em>n</em>에 대해 아래와 같이 정의된다.</p>\n\n<p><em>&phi;</em>(<em>n</em>) = (<em>n</em>이하이고 <em>n</em>과 서로 소인(즉, 최대공약수가 1인) 자연수의 개수)</p>\n\n<p>이를 테면, 1과 1의 최대공약수가 1이므로 <em>&phi;</em>(1) = 1이며, 6의 경우 1, 5가 각각 6과의 최대공약수가 1이므로 <em>&phi;</em>(6) = 2이다. 또한, <em>&phi;</em>(9) = 6이다.</p>\n\n<p>자연수 <em>N</em>과 <em>K</em>가 입력으로 주어질 때에 <em>&phi;</em>(<em>n</em>) &ge; <em>n</em> &ndash; <em>K</em> 이고 <em>n</em> &le; <em>N</em>인 자연수 <em>n</em>의 개수를 세어 출력하는 프로그램을 작성하시오.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>입력</strong></p>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 한 줄에 자연수 <em>N</em>과 <em>K</em>가 주어진다. <em>N</em>과 <em>K</em>는 모두 1 이상, 600 이하이다.</p>\n\n<p><strong>출력</strong></p>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 입력에 대한 답을 정수 형태로 한 줄에 출력한다.</p>\n','2973380830030ab71c7267b453c90d89','false','중','2017-11-12 22:48:00','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 22:48:15'),(188,'관리자','직육면체의 대각','<p>최근 블록쌓기 놀이에 푹 빠져 있는 동현이를 위해 아버지인 철수는 변의 길이가 1인 정육면체 형태의 블록을 <em>N</em>개 사주었다.<br />\n동현이는 이 블록들을 이용하여 직육면체 형태를 만들기를 특히 좋아하였는데,<br />\n철수가 생각지도 못한 여러 가지 다른 크기와 형태의 직육면체를 만들기도 하였다.</p>\n\n<p><img alt=\"\" src=\"./dist/img/square.jpg\" style=\"height:350px; width:350px\" /></p>\n\n<p><strong>(그림 1) 동현이가 만든 직육면체 중 하나. 이 경우는 대각선의 길이가 정수가 아니다.</strong></p>\n\n<p>&nbsp;</p>\n\n<p>평소에도 수학에 관심이 있던 철수는 어느 날 동현이가 블록으로 만든 직육면체를 보다가 그 직육면체의 대각선의 길이가 정수가 된다는 걸 알아챘다.<br />\n직육면체의 대각선이란 직육면체의 꼭지점 중 가장 먼 둘을 이은 선을 말한다. 철수는 어떤 경우에 직육면체의 대각선의 길이가 정수가 되는지 알고 싶다.</p>\n\n<p>한 변의 길이가 1인 정육면체 블록 <em>N</em>개 이하를 이용하여 만들 수 있는 직육면체 중에서 대각선의 길이가 정확히 정수가 되는 것들의 개수를 세는 프로그램을 작성하시오.<br />\n두 직육면체는 회전하였을 때 일치하거나 서로 거울상(mirror image)으로 보이면 같은 것으로 취급한다.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>입력</strong></p>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 첫 줄에 블록 개수인 <em>N</em>이 정수형태로 주어지며, <em>N</em>은 최소 1, 최대 100,000이다.</p>\n\n<p><strong>출력</strong></p>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 입력으로 주어진 <em>N</em>에 대해 <em>N</em>개의 블록으로 만들 수 있는 직육면체 모양 중 대각선의 길이가 정확히 정수가 되는 것들의 개수를 출력한다.</p>\n','f33dcb8abdc7d0441de90c1d8a2df30c','false','중','2017-11-12 22:49:00','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 22:54:22'),(189,'관리자','삼각형','<p><em>n&nbsp;</em>개의 봉이 있습니다. 봉 <em>i&nbsp;</em>의 길이는 <img src=\"http://latex.codecogs.com/gif.latex?a_{i}\" /> 입니다. 경기대 학생이 3개의 봉을 선택하여 가능한 넓이가 가장 큰 삼각형을 만들려고 합니다. 넓이가 가장 큰 삼각형의 3변의 길이를 구하세요. (만약 삼각형을 만들 수 없는 경우에는 0을 답합니다.)</p>\n\n<p>힌트: 3변의 길이를 알 때 삼각형의 넓이를 구하는 공식</p>\n\n<p>삼각형의 세 변의 길이 <em>a, b, c</em>를 알고, 세변의 길이로부터 <em>s</em>의 값을 공식 <img src=\"http://latex.codecogs.com/gif.latex?s=\\frac{a+b+c}{2}\" />을 활용해서 구한다. 이 후 넓이 <em>S</em>는 공식 1을 활용하여 삼각형의 세 변의 길이 <em>a, b, c</em> 그리고 <em>s</em>의 값을 넣어 구할 수 있다.</p>\n\n<p><em><img src=\"http://latex.codecogs.com/gif.latex?s&amp;space;=&amp;space;\\sqrt{s(s-a)(s-b)(s-b)}\" /> ---------------------------------------(1)</em></p>\n\n<p>&nbsp;</p>\n\n<p>아래와 같이 5개의 봉이 있고, 각 봉의 길이가 2, 3, 4, 5, 10인 봉이 존재할 경우를 예를 들어보자.</p>\n\n<p><img alt=\"\" src=\"./dist/img/bar1.png\" style=\"height:104px; width:564px\" /></p>\n\n<p>이 때 그림 1과 같이 3개의 봉을 골라 가능한 넓이가 가장 큰 삼각형을 만든다.</p>\n\n<p><img alt=\"\" src=\"./dist/img/bar2.png\" /></p>\n\n<p><strong>(</strong><strong>그림 </strong><strong>1</strong><strong>) </strong><strong>세 변의 길이가 3, 4, 5인 삼각형</strong></p>\n\n<p>&nbsp;</p>\n\n<p>세 변의 길이가 3, 4, 5에서 <em>s</em>의 값은 &nbsp; 이 된다. 이 때 공식 1을 사용하여 삼각형의 넓이가 6이 된다는 것을 알 수 있다.</p>\n\n<p>&nbsp;</p>\n\n<p><img src=\"http://latex.codecogs.com/gif.latex?s&amp;space;=&amp;space;\\sqrt{6(6-3)(6-4)(6-5)}=6\" /></p>\n','727363cb556e1d15379c5934470d435b','false','중','2017-11-12 22:57:23','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 23:13:10'),(190,'관리자','피보나치 수의 개수','<p>피보나치 수는 다음과 같은 식으로 정의된다.</p>\n\n<p>&nbsp;</p>\n\n<p><img src=\"http://latex.codecogs.com/gif.latex?\\\\f_1:=1&amp;space;\\\\f_2:=2&amp;space;\\\\f_n:=f_{n-1}+f_{n-2}(n\\geq&amp;space;3)\" /></p>\n\n<p><em>a</em>와 <em>b</em>라는 두 수가 주어지고, 피보나치 딜레마의 수인 <em>c</em>가 주워졌을때 [<em>a,b</em>]구간에 피보나치의 수의 개수를 계산한다.<br />\n이 때 피보나치 수의 마지막 자리 숫자 (맨 오른쪽에 있는 숫자)가 피보나치 딜레마의 수인 <em>c</em>와 같을 경우 피보나치 수의 개수 카운트에서 제외시킨다.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>힌트</strong><strong>: </strong><strong>자바에서</strong><strong> </strong><strong>큰</strong><strong> </strong><strong>숫자를</strong><strong> </strong><strong>다루는</strong><strong> Library</strong><strong>인</strong><strong> BigInteger </strong><strong>활용하면</strong><strong> </strong><strong>큰</strong><strong> </strong><strong>수를</strong><strong> </strong><strong>쉽게</strong><strong> </strong><strong>다룰</strong><strong> </strong><strong>수</strong><strong> </strong><strong>있음</strong><strong>.</strong></p>\n\n<p>&nbsp;</p>\n\n<p><strong>&lt;</strong><strong>클래스</strong><strong>:</strong> java.math.BigInteger&gt;</p>\n\n<p><strong>생성자</strong><strong>:</strong> public BigInteger(String val)</p>\n\n<p><strong>비교</strong><strong>:</strong> public int compareTo(BigInteger val), <strong>반환값</strong><strong>:</strong> 같으면 0, 작으면 -1, 크면 1</p>\n\n<p><strong>덧셈연산</strong><strong>:</strong> public BigInteger add(BigInteger val), <strong>반환값</strong><strong>:</strong> 덧셈한 결과 BigInteger</p>\n\n<p><strong>나머지연산</strong><strong>:</strong> public BigInteger remainder(BigInteger val), <strong>반환값</strong><strong>:</strong> 나머지 결과 BigInteger</p>\n\n<p>BigInteger에 0 값 명시: BigInteger.ZERO</p>\n\n<p>BigInteger에 1 값 명시: BigInteger.ONE</p>\n\n<p>&lt;클래스: java.util.Scanner&gt;</p>\n\n<p>BigInteger 입력 받기: public BigInteger nextBigInteger()</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ex) BigInteger a = sc.nextBigInteger();</p>\n\n<p>&nbsp;</p>\n\n<p><strong>입력</strong></p>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 한 줄에 정수 <em>a</em>, <em>b</em>, <em>c</em>가 주어진다. 각 정수의 범위는 <img src=\"http://latex.codecogs.com/gif.latex?2&lt;a\\leq&amp;space;b\\leq&amp;space;10^{100}\" /> 이며, <img src=\"http://latex.codecogs.com/gif.latex?0\\leq&amp;space;c\\leq&amp;space;9\" /> 이다.</p>\n\n<p><strong>출력</strong></p>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 정수 <em>a, b, c</em>에 대하여 피보나치의 수를 정확히 정수 형태로 출력한다.</p>\n','701597f474c23e07c812cc1254dc97ee','false','중','2017-11-12 23:22:00','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 23:22:23'),(191,'관리자','클래스 자르기 (Cutting Class)','<p>&nbsp;</p>\n\n<p>하나의 프로그램을 효율적으로 객체화시키기 위해서는 한 클래스의 코드를 잘 절단시켜 여러 개의 클래스로 구조화 시킬 수가 있다. 효율적인 프로그래밍 기법으로 잘 알려진 이공대학 컴퓨터과학과에서는 클래스를 구조화시키기 위해 쪼개진 클래스의 코드길이에 따라 요금을 부과한다. 코드 절단 시 두 가지 규칙이 존재하는데, 우선 클래스 구조상 코드의 절단은 한 번에 하나씩만 할 수 있다. 그리고 코드 절단 시 해당 코드 라인의 다음 줄을 절단한다고 가정한다. 요금은 코드 절단 전 구간 전체 길이의 수가 된다. 예를 들어 코드길이가 10인 클래스를 자르면 비용은 10이며, 쪼개진 클래스 길이가 4인 코드를 절단할 경우 비용은 4가 된다.</p>\n\n<p>코드절단 순서에 따라 요금이 달라진다는 것은 그리 어렵지 않게 알 수 있다. 예를 들어 전체 코드라인 10인 클래스의 처음부터 2, 4, 7라인에서 코드를 구조화 하는 경우를 생각해보자. 구조화 시킬 수 있는 방법은 매우 다양하다. 처음에 2번째 라인에서 자르고 그 다음에 4번째 라인, 마지막으로 7번째 라인에서 자를 수도 있다. 이렇게 하면 요금은 10+8+6=24가 된다. 첫 번째 코드의 길이는 10이고, 그 다음 코드의 길이는 8라인이였고, 마지막으로 코드의 길이가 6라인 이였기 때문이다. 하지만 일단 4번째 라인에서 자르고 2번째 라인에서 자른 후 마지막으로 7번째 라인에서 자른다면 요금이 10+4+6=20이 되기 때문에, 앞에서 잘랐던 방법으로 하는 것보다 요금을 줄일 수 있다. 어떤 클래스가 주어졌을 때, 최소 절단 요금을 구하는 프로그램을 만들어보자.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>입력</strong></p>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 세 줄로 구성되어 있다. 첫째 줄에는 자를 클래스의 코드길이를 나타내는 양의 정수 <em>l</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:15pt; width:3.75pt\" /> 이 입력된다. <em>l</em><img src=\"file:///C:\\Users\\Minsung\\AppData\\Local\\Temp\\msohtmlclip1\\01\\clip_image001.png\" style=\"height:15pt; width:3.75pt\" /> 은 1,000 이하라고 가정하자. 그 다음 줄에는 잘라야 될 횟수 <em>n</em>(<em>n</em>&lt;50)&nbsp;이 입력된다.</p>\n\n<p>그 다음 줄에는 <img src=\"http://latex.codecogs.com/gif.latex?c_i(0&lt;c_i&lt;l)\" />가 입력되는데, 이 숫자들은 코드를 잘라야 할 위치를 나타내며, 오름차순으로 입력된다. (같은 정수가 두 번 입력되는 일은 없다).</p>\n\n<p>&nbsp;</p>\n\n<p><strong>출력</strong></p>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 입력에 대한 답을 정수 형태 최소비용이 한 줄에 출력한다. 예를 들어 최소 비용이 200일 경우 &ldquo;200&rdquo;이 출력된다.</p>\n','7b1b1df3ba10f4354d100a638e502e8a','false','중','2017-11-12 23:23:36','2017-12-31 12:59:00',2,'201215595',35,'2017-11-12 23:26:59'),(199,'관리자','문제 A – Happy Number','<p>&nbsp;자연수 n에 대해, f(n)은 n을 10진수로 표현했을 때의 각 자릿수의 제곱의 합을 의미하는 함수이다.</p>\n\n<p>&nbsp;예를 들어, n=19이면 <img alt=\"1^{2}+9^{2}=82\" src=\"http://latex.codecogs.com/gif.latex?​​1^{2}+9^{2}=82\" style=\"height:14px; width:75px\" />이므로 <img alt=\"\" src=\"http://latex.codecogs.com/gif.latex?f\\left ( 19 \\right )=82\" style=\"height:14px; width:68px\" />이다.</p>\n\n<p>&nbsp;이 함수를 n부터 시작하여 연속적으로 적용하면, 결국 1이 되는 경우가 있다. 그런 정수를 행복한 수(happy number)라고 부른다. 예를 들어, n=19인 경우,<br />\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <img alt=\"f\\left ( 19 \\right )=1^{2}+9^{2}=82\" src=\"http://latex.codecogs.com/gif.latex?f\\left ( 19 \\right )=1^{2}+9^{2}=82\" style=\"height:20px; width:166px\" /><br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em>&nbsp;&nbsp;<img alt=\"\" src=\"http://latex.codecogs.com/gif.latex?f\\left ( 82 \\right )=8^{2}+2^{2}=68\" style=\"height:20px; width:166px\" /></em><br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em>&nbsp;&nbsp;<img alt=\"\" src=\"http://latex.codecogs.com/gif.latex?f\\left ( 68 \\right )=6^{2}+8^{2}=100\" style=\"height:20px; width:175px\" /></em><br />\n&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<em>&nbsp;&nbsp;<img alt=\"\" src=\"http://latex.codecogs.com/gif.latex?f\\left ( 100 \\right )=1^{2}+0^{2}+0^{2}=1\" style=\"height:20px; width:203px\" /></em><br />\n가 되므로, 19는 행복한 수이다. 하지만 모든 자연수가 행복한 수이지는 않다. 5에서 출발한다면 5는 행복한 수가 아니라는 것을 쉽게 알 수 있다. 자연수 n이 행복한 수가 아닌 경우에는 위 함수를 연속적으로 적용할 때 아래와 같은 사이클이 형성된다는 것이 알려져 있다고 한다.</p>\n\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;4&rarr;16&rarr;37&rarr;58&rarr;89&rarr;145&rarr;42&rarr;20&rarr;4</p>\n\n<p>임의의 자연수가 입력으로 주어질 때, 그것이 행복한 수인지 아닌지를 알아내는 프로그램을 작성하시오.</p>\n\n<p>&nbsp;</p>\n\n<h2><strong>입력</strong></h2>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 한 줄에 자연수 n이 주어지며, n의 범위는 1 이상 1,000,000,000 이하이다.</p>\n\n<h2><strong>출력</strong></h2>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 자연수 n이 행복한 수이 &ldquo;HAPPY&rdquo;를 아니면 &ldquo;UNHAPPY&rdquo;를 한 줄에 출력하라. <strong>&nbsp;</strong></p>\n','723dbcea92280a5068bc070903e876f3','false','하','2017-11-28 17:29:00','2017-11-28 19:30:00',1,'201611841',37,'2017-11-24 22:59:41'),(200,'관리자','문제 B – Queen’s Problem','<p>&nbsp;체스(chess)에서 가장 오래된 전략 시뮬레이션 보드게임 중 하나로 체스판 위의 말들을 잘 조정하여 상대의 왕(king)을 잡는 게임이다. 여러 종류의 말들 중, 퀸(Queen)은 가장 강력한 힘을 자랑하는데 한 번에 대각선 또는 직선으로 이동거리의 제한 없이 움직일 수 있으며 그 중에 상대의 말이 있으면 잡을 수 있다. 아래의 왼쪽 그림과 같이 검은 원의 위치에 퀸에 있다면 회색 원의 위치 중 한 곳으로 한번에 이동할 수 있다.</p>\n\n<p><img alt=\"\" src=\"./dist/img/chess0.gif\" style=\"height:161px; width:160px\" />&nbsp;&nbsp;<img alt=\"\" src=\"./dist/img/chess1.jpg\" style=\"height:161px; width:162px\" /></p>\n\n<p>&nbsp;이 문제에서는 약간 상황을 달리 하여 N x N 크기의 체스판 위에 N개의 퀸이 놓여 있을 경우를 가정한다. 여왕들은 서로가 서로에게 위험한 상황을 만들고 싶어하지 않는다. 이를 테면, 두 개의 퀸이 서로 공격 가능한 위치에 있을 경우 (예를 들면, 서로 직선 혹은 대각선 위치에 놓여 있을 경우)에는 여왕들은 위험한 상황에 있게 되며, 매우 언짢아 한다. 위 그림 중 오른쪽 상황은 N = 8인 경우에 8개의 퀸이 모두 안전하게 위치하고 있는 경우를 그린 것이다.</p>\n\n<p>&nbsp;자연수 N과 N개의 퀸의 위치가 주어질 때에 이들이 위험한 상황에 있는지 아닌지 판단하는 프로그램을 작성하시오. 퀸의 위치는 체스판에서 (x, y)의 좌표로 주어지며 맨 왼쪽 아래 구석의 위치를 (1, 1)로, 맨 오른쪽 위 구석의 위치를 (N, N)으로 한다.</p>\n\n<p>&nbsp;</p>\n\n<h2><strong>입력</strong></h2>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 첫 줄에 자연수 N이 주어지고, 그 이후 N개의 줄에 N개의 퀸의 위치가 두 개의 자연수로 주어진다. N의 범위는 1~1000 이다.</p>\n\n<h2><strong>출력</strong></h2>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 입력에 대해 현재 상태가 위험한 상황이면 DANGER, 그렇지 않으면 SAFE라고 한 줄에 출력한다.</p>\n','e82436c5e51adb3f3f67055c6b87d115','false','하','2017-11-28 17:30:00','2017-11-28 19:30:00',1,'201611841',37,'2017-11-24 23:07:31'),(201,'관리자','문제 C – Word','<p>&nbsp;영문자 a, b, c, d, e, f, g, h의 8 글자로 만들 수 있는 순열(permutation)은 총 40,320개가 있다. 이들을 전부 사전순서로 배열하여 차례대로 번호를 매기면 아래와 같다.</p>\n\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;<img alt=\"\" src=\"./dist/img/word.png\" style=\"height:200px; width:151px\" /></p>\n\n<p>&nbsp;위와 같이 a, b, c, d, e, f, g, h의 8자의 순열인 문자열이 주어졌을 때에, 그것이 몇 번째인지 출력하는 프로그램을 작성하시오.</p>\n\n<p>&nbsp;</p>\n\n<h2><strong>입력</strong></h2>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 첫 줄에 a, b, c, d, e, f, g, h의 순열(8글자의 단어)이 하나 주어진다.</p>\n\n<h2><strong>출력</strong></h2>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 단어의 순서가 몇 번째인지 한 줄에 출력한다.</p>\n','6ea831e54ee5a7168b71951d3e9c4912','false','중','2017-11-28 17:30:00','2017-11-28 19:30:00',1,'201611841',37,'2017-11-24 23:13:39'),(202,'관리자','문제 D – 스티커','<p>&nbsp;당신의 어린 여동생인 봉숙이는 2N개의 작은 스티커가 2행, N열 꼴로 배치되어 있는 스티커 세트를 선물로 받았다. 아래 그림의 왼쪽을 참고하라. 봉숙이는 스티커를 이용해서 자기 책상을 꾸미고 싶어한다. 그런데 문제는 이 스티커 세트의 품질이 좋지 못하여 하나의 스티커를 떼어내면 그것과 위, 아래, 왼쪽, 오른쪽과 접해 있는 스티커들이 손상되어 쓸 수 없게 된다는 점이다.</p>\n\n<p><img alt=\"\" src=\"./dist/img/sticker0.png\" style=\"height:150px; width:336px\" />&nbsp;&nbsp;<img alt=\"\" src=\"./dist/img/sticker1.png\" style=\"height:150px; width:332px\" /></p>\n\n<p>&nbsp;어쩔 줄 몰라 하는 봉숙이에게 당신은 각 스티커에 점수를 매기고 그 점수의 합이 최대가 되도록 가능한 스티커들을 골라보면 어떻겠냐고 조언해주었다. 봉숙이는 위의 오른쪽 그림과 같이 각 스티커에 점수를 주었으나, 그 다음에는 어떡해야 할 지를 몰랐다. 봉숙이를 도울 수 있는 프로그램을 작성하라. 즉, 2N개의 스티커에 대한 점수들이 입력으로 주어질 때에, 점수의 합이 최대인 서로 인접하지 않은 스티커들을 골라내는 프로그램이다.</p>\n\n<p>&nbsp;예를 들어 위의 오른쪽 그림과 같이 10개의 스티커에 점수가 매겨져 있을 경우, 얻을 수 있는 최대 점수의 합은 260이다. (50, 50, 100, 60점인 스티커 4개를 고르는 것이 최선이다.) 안타깝게도 이 경우에는 봉숙이가 두 번째로 좋아하는 70점짜리 스티커를 고를 수가 없다.</p>\n\n<p>&nbsp;</p>\n\n<h2><strong>입력</strong></h2>\n\n<p>입력은 표준입력(standard input; 키보드를 통한 입력)을 사용한다. 입력은 세 줄로 주어진다. 첫 줄에는 정수 N이 주어지며 범위는 1이상 100,000이하이다. 그 다음 두 줄에는 각각 N개의 정수가 공백문자로 구분되어 주어진다. 각 정수는 그 위치의 스티커의 점수를 의미한다. 봉숙이가 매긴 점수는 0 이상 100 이하이다.</p>\n\n<h2><strong>출력</strong></h2>\n\n<p>출력은 표준출력(standard output; 모니터 화면에 출력)을 사용한다. 주어진 입력에 대해 획득 가능한 최대의 점수의 합을 출력하라.</p>\n','f54c2273fd00984ea259762ee114ebae','false','상','2017-11-28 17:30:00','2017-11-28 19:30:00',1,'201611841',37,'2017-11-24 23:20:22'),(207,'p3담당자','피보나치 수열','<p>F(1)=F(2)=1이고 F(n+2)=F(n+1)+F(n)을 만족합니다.</p>\n\n<p>이 수식이 성립할 때 n의 값을 입력받고 F(n)의 값과 n번째까지의 수들을 출력해 보세요.</p>\n\n<p>5를 입력받았다면 &ldquo;5&rdquo;와 &ldquo;1 1 2 3 5&rdquo;를 출력합니다.</p>\n','db07344e74b50df5384c4005f0d0acba','false','중',NULL,NULL,2,'p3proftest1',NULL,'2018-01-14 18:54:56'),(209,'p3담당자','동전 교환','<p>액면가가 다른 동전의 종류와 교환할 총 돈의 양이 주어진다.</p>\n\n<p>이 때 최소한의 동전 개수로 교환할 수 있는 동전의 수를 구하는 프로그램을 작성하라.</p>\n\n<p>주어진 동전으로 교환이 불가한 경우 &ndash;1을 반환한다.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>입력</strong></p>\n\n<p>첫째 줄에 동전종류의 개수가 주어진다.</p>\n\n<p>둘째 줄에 동전의 액면가가 주어진다.</p>\n\n<p>셋째 줄에 바꿀 총 돈의 양이 주어진다.</p>\n\n<p>&nbsp;</p>\n\n<p><strong>출력</strong></p>\n\n<p>첫째 줄에 문제의 정답을 출력한다.</p>\n\n<p>&nbsp;</p>\n','e4a46806428142c2ccad48f6df247d9f','false','중',NULL,NULL,2,'p3proftest3',NULL,'2018-01-15 20:37:36');
